        <div className="cards">
          <div style={{ left: "14rem" }}>
            <Card
              emoji={Heartemoji}
              heading={"Design"}
              detail={"Figma, Sketch, Photoshop, Adobe,Photoscapping"}
            />
          </div>
          <div style={{ top: "12rem", left: "-4rem" }}>
            <Card
              emoji={Glasses}
              heading={"Develpoer"}
              detail={"Html, CSS, JS, react,Bootstrap"}
            />
          </div>
          <div style={{ top: "19rem", left: "12rem" }}>
            <Card
              emoji={Humble}
              heading={"UI/UX"}
              detail={"Loerm ispum is a great"}
            />
                  </div>
                  <div className="blur s-blur2" style={{background:'var()'}}></div>
        </div>
      </div>
    </>
  );
}

export default Services;
